  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (53,520 records)
  were gathered by various governmental organizations (and academia) using a variety
  of methods. This data base was received in November 1980. Principal gravity parameters
  include Free-air Anomalies and Simple Bouguer Anomalies (no terrain correction applied).
  The observed gravity values are referenced to the International Gravity Standardization
  Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic Reference
  System 1967 (GRS 67) theoretical gravity formula. The data are randomly distributed
  within the boundaries of the National Petroleum Reserve-Alaska (NPRA).\",\n\t\"license_title\":
